FROM score_soft_max LEFT OUTER JOIN (SELECT union_with_max."KEY" AS "KEY_Score", min(union_with_max.class) AS "arg_max_Score" 
FROM union_with_max 
WHERE union_with_max."max_Score" <= union_with_max."Score" GROUP BY union_with_max."KEY") AS "arg_max_t_Score" ON score_soft_max."KEY" = "arg_max_t_Score"."KEY_Score" LEFT OUTER JOIN (SELECT score_soft_max."KEY" AS "KEY_softmax", score_soft_max."exp_delta_Score_0" / score_soft_max."sum_ExpDeltaScore" AS "SoftProba_0", score_soft_max."exp_delta_Score_1" / score_soft_max."sum_ExpDeltaScore" AS "SoftProba_1", score_soft_max."exp_delta_Score_2" / score_soft_max."sum_ExpDeltaScore" AS "SoftProba_2" 
FROM score_soft_max) AS soft_max_comp ON soft_max_comp."KEY_softmax" = "arg_max_t_Score"."KEY_Score")
 SELECT arg_max_cte."KEY" AS "KEY", CAST(NULL AS DOUBLE) AS "Score_0", CAST(NULL AS DOUBLE) AS "Score_1", CAST(NULL AS DOUBLE) AS "Score_2", arg_max_cte."SoftProba_0" AS "Proba_0", arg_max_cte."SoftProba_1" AS "Proba_1", arg_max_cte."SoftProba_2" AS "Proba_2", CASE WHEN (arg_max_cte."SoftProba_0" IS NULL) THEN arg_max_cte."SoftProba_0" ELSE CASE WHEN (arg_max_cte."SoftProba_0" > 0.0) THEN log(arg_max_cte."SoftProba_0") ELSE -1.79769313486231e+308 END END AS "LogProba_0", CASE WHEN (arg_max_cte."SoftProba_1" IS NULL) THEN arg_max_cte."SoftProba_1" ELSE CASE WHEN (arg_max_cte."SoftProba_1" > 0.0) THEN log(arg_max_cte."SoftProba_1") ELSE -1.79769313486231e+308 END END AS "LogProba_1", CASE WHEN (arg_max_cte."SoftProba_2" IS NULL) THEN arg_max_cte."SoftProba_2" ELSE CASE WHEN (arg_max_cte."SoftProba_2" > 0.0) THEN log(arg_max_cte."SoftProba_2") ELSE -1.79769313486231e+308 END END AS "LogProba_2", arg_max_cte."arg_max_Score" AS "Decision", CASE WHEN (arg_max_cte."SoftProba_0" <= CASE WHEN (arg_max_cte."SoftProba_1" <= arg_max_cte."SoftProba_2") THEN arg_max_cte."SoftProba_2" ELSE arg_max_cte."SoftProba_1" END) THEN CASE WHEN (arg_max_cte."SoftProba_1" <= arg_max_cte."SoftProba_2") THEN arg_max_cte."SoftProba_2" ELSE arg_max_cte."SoftProba_1" END ELSE arg_max_cte."SoftProba_0" END AS "DecisionProba" 
FROM arg_max_cte